import React from "react";
import styles from "./Line.module.scss";
const Line = () => {
  return (
    <div className={styles.line}>
      <div className={styles.button}>
          <div></div>
          <div></div>
      </div>
      <div className={styles.right}></div>
    </div>
  );
};

export default Line;
